    <p>
      Die Bilder sind nicht in der FreePlane-Datei selber gespeichert. Es ist lediglich ein relativer Link auf das Bild gespeichert.
    </p>
    <p>
      Darum empfiehlt es sich, die Bilder einer FreePlane-Map z.B: in einem Unterverzeichnis dieser FreePlane-Datei abzuspeichern.
    </p>
