<node TEXT="Drag &amp; Drop, 3 ways" ID="ID_392450033" CREATED="1767706862476" MODIFIED="1767707116090"><richcontent TYPE="NOTE">
<html>
  <head>
    
  </head>
  <body>
    <p>
      Aus dem Windows Explorer kann man ein Bild mit Drag &amp; Drop in ein MindMap ziehen.
    </p>
    <p>
      Je nachdem, in welcher Position auf dem Node man die Maustaste loslässt, wird das Bild anders eingefügt.
    </p>
    <p>
      Dies wird durch unterschiedliche Einfärbungen angezeigt, je nach Mausposition. Zum Beispiel an der Position im Knoten, wo die Unterknoten befestigt werden. Dann wird auch das Bild wie ein Unterknoten behandelt.
    </p>
  </body>
</html></richcontent>
</node>
